import React from "react";

function Viewpost(props) {
  console.log(props.posts);
  return (
    <div className="postcard">
      {props.posts ? <h1>data</h1> : <h1>dsd</h1>}
      <h1>Title</h1>
      <p className="author">Karthik sb</p>
      <p></p>
    </div>
  );
}

export default Viewpost;
